    };
  }

  render() {
    return (
      // <!--Section: Contact v.2-->
      <section class="mb-4" style={{ marginTop: '70px' }}>

        {/* <!--Section heading--> */}
        <h2 class="h1-responsive text-center my-4">Order management</h2>
        <div class="row">

          {/* <!--Grid column--> */}
          <div class="col-md-12 mb-md-0 mb-5" style={{ border: '1px solid red' }}>
            {/* <!-- Material inline form --> */}
            <form class="form-inline">
              {/* <!-- Material input --> */}
              <label style={{fontWeight:'bold',marginRight:'2px'}}>Order:</label>
              <MDBInput label="Id." outline/>


            </form>
            {/* <!-- Material inline form --> */}
          </div>
        </div>

      </section>
    );
  }
}

export default Home;
